import React, { Children } from "react";

function Form(props) {
  return (
    <div class="card card-white bg-white p-4 shadow-md border rounded-lg md:grid-cols-12 m-4">
      <div className="card-header bg-info-700 p-2 rounded">
        <h2 class="text-lg font-semibold">{props.title}</h2>
        <button type="button" class="bg-white rounded-md p-2 inline-flex items-center justify-center text-gray-400 hover:text-gray-500 hover:bg-gray-100 focus:outline-none focus:ring-2 focus:ring-inset focus:ring-indigo-500">
              <span class="sr-only">Close menu</span>
              <svg class="h-6 w-6" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor" aria-hidden="true">
                <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M6 18L18 6M6 6l12 12" />
              </svg>
        </button>
      </div>
      <div class="card-body text-gray-600 mt-5">
        <form>{Children.toArray(props.children)}</form>
      </div>
    </div>
  );
}

export default Form;
